import React from 'react';
import featureImage1 from '../img/img1.png';
import featureImage2 from '../img/img2.png';
import featureImage3 from '../img/img3.png';
import './styles/Process.css';

const Process = () => {
    return (
        <section className="process-container">
            <div className="image-container">
                <img src={featureImage1} className="img-fluid rounded shadow" alt="Feature 1" />
                <img src={featureImage2} className="small-image" alt="Feature 2" />
                <img src={featureImage3} className="small-image" alt="Feature 3" />
            </div>
            <div className="steps-wrapper">
                <div className="step-item">
                    <span className="step-number">1</span>
                    <span className="step-text">Upload Your Photo</span>
                </div>
                <div className="step-item">
                    <span className="step-number">2</span>
                    <span className="step-text">Watch the Magic Happen</span>
                </div>
                <div className="step-item">
                    <span className="step-number">3</span>
                    <span className="step-text">Save & Share Your Natural Look</span>
                </div>
            </div>
        </section>
    );
};

export default Process;
